Object.keys = Object.keys || function(
    o, // object
    k, // key
    r  // result array
) {
    // initialize object and result
    r = [];
    // iterate over object keys
    for (k in o)
        // fill result array with non-prototypical keys
        r.hasOwnProperty.call(o, k) && r.push(k);
    // return result
    return r
};


var App = {

    _registerMenu: function()
    {
        this.menu = new App.Menu;
        this.menu.init();
    },
    _registerLogin: function()
    {
        this.login = new App.Login;
        this.login.init();
    },
    

    _registerTooltips: function()
    {
        this.tooltip = new App.Tooltip;
        this.tooltip.init();
    },

    _registerSelectInputs: function()
    {
        jQuery('select').selectpicker();
    },

    _registerDatePicker: function()
    {
        jQuery('.datepicker').pikaday({
            format: 'DD/MM/YYYY',
            yearRange: 10,
            i18n: {
                previousMonth : 'ย้อนหลัง',
                nextMonth     : 'ถัดไป',
                months        : [
                    'มกราคม',
                    'กุมภาพันธ์',
                    'มีนาคม',
                    'เมษายน',
                    'พฤษภาคม',
                    'มิถุนายน',
                    'กรกฎาคม',
                    'สิงหาคม',
                    'กันยายน',
                    'ตุลาคม',
                    'พฤศจิกายน',
                    'ธันวาคม'],
                weekdays      : ['อาทิตย์','จันทร','อังคาร','พุธ','พฤหัส','ศุกร์','เสาร์'],
                weekdaysShort : ['อา.','จ.','อ.','พ.','พฤ.','ศ.','ส.']
            }
        });
    },
    _registerPageNavigator: function()
    {
        jQuery('select', '.page-navigator').on('change', function()
        {
            if(url = $(this).val())
            {
                window.location.href = url;
            }
        });
    },

    init: function()
    {
        this._registerMenu();
        this._registerLogin();
        this._registerTooltips();
        this._registerSelectInputs();
        this._registerDatePicker();
        this._registerPageNavigator();
    }
    
};

App.Menu = function() {
    this.el = $('');
    this.menu = $('');
}

App.Menu.prototype = {
    init: function()
    {
       $(document).on('mouseup', function(e)
        {
            subject = App.menu.menu;

            if(e.target.id != subject.attr('id') && !subject.has(e.target).length)
            {
                App.menu.hide();
            }

        });

        $(window).on('resize', function(e)
        {
            App.menu.resize();
        })
        .on('scroll', function(e)
        {
            // App.menu.hide();
        });
        
        this.el.on('click', function(e)
        {
            e.stopPropagation();
            App.menu.show();
        });
    },

    resize: function(el)
    {
        this.menu.children('.menu-content').css('max-height', $(window).height() - 100);
    },

    show: function()
    {
        this.menu.toggleClass('show');
    },

    hide: function()
    {
        this.menu.removeClass('show');
    }
}
App.Login = function() {
    this.el = $('');
    this.login = $('');
}

App.Login.prototype = {
    init: function()
    {
       $(document).on('mouseup', function(e)
        {
            subject = App.login.login;

            if(e.target.id != subject.attr('id') && !subject.has(e.target).length)
            {
                App.login.hide();
            }

        });

        $(window).on('resize', function(e)
        {
            App.login.resize();
        })
        .on('scroll', function(e)
        {
            // App.menu.hide();
        });
        
        this.el.on('click', function(e)
        {
            e.stopPropagation();
            App.login.show();
        });
    },

    resize: function(el)
    {
        this.login.children('.login-content').css('max-height', $(window).height() - 100);
    },

    show: function()
    {
        this.login.toggleClass('show');
    },

    hide: function()
    {
        this.login.removeClass('show');
    }
}
App.Tooltip = function() {
    this.el = '[data-toggle="tooltip"]';
};

App.Tooltip.prototype.init = function(el)
{
    $el = $(el || this.el) ;
    
    $el.tooltip();
}
